import React, { Component } from 'react'
import { Card, Rate } from 'antd';
const products = [{
    name: 'camera',
    rate: 4,
    quality: 3
}, {
    name: 'mobile',
    rate: 1,
    quality: 2
}, {
    name: 'laptop',
    rate: 2,
    quality: 1
}, {
    name: 'bike',
    rate: 5,
    quality: 3
}, {
    name: 'guitar',
    rate: 3,
    quality: 3
}];
export default class ProductList extends Component {

    render() {
        return (
            <div>
                <Card title="Product List">
                    {products.map(prd => {
                        return <Card.Grid >
                            <p>
                                <span>Product name -</span> <span>{prd.name}</span>
                            </p>
                            <p>
                                <span>Product Rate -</span> <span>{prd.rate}</span>
                            </p>
                            <p>
                                <span>Product Quality -</span><span>  {prd.quality}</span>
                            </p>
                        </Card.Grid>
                    })}
                </Card>

            </div >
        )
    }
}
